import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import {
    AppBar,
    Toolbar,
    ListItem,
    IconButton,
    ListItemText,
    Avatar,
    Divider,
    List,
    Typography,
    Box,
    ListItemIcon
} from "@material-ui/core";
import {
    ArrowBack,
    AssignmentInd,
    Home,
    Apps,
    ContactMail
} from "@material-ui/icons";
import avatar from "../profile-pic.jpg"

const useStyles = makeStyles(theme => ({
    navSlideContainer: {
        width: 250,
        background: "#212121",
        height: "30rem"
    },
    avatar: {
        display: "block",
        margin: "05rem auto",
        width: theme.spacing(13),
        height: theme.spacing(13)
    }
}));

const barItems = [
    {
        listIcon: <Home />,
        listText: "Home"
    },
    {
        listIcon: <AssignmentInd />,
        listText: "Resume"
    },
    {
        listIcon: <Apps />,
        listText: "Portfolio"
    },
    {
        listIcon: <ContactMail />,
        listText: "Contact"
    }
]

function Navbar() {
    const classes = useStyles()
    return (
        <>
            <Box className={classes.navSlideContainer} component="div">
                <Avatar className={classes.avatar} src={avatar} alt="Profile Picture" />
                <Divider />
                <List>
                    {barItems.map((listItem, key)=>(
                    <ListItem>
                            <ListItemIcon>

                        </ListItemIcon>
                        <ListItemText/>

                        </ListItem>
                    ))}
                </List>
            </Box>
            <Box component="div">
            </Box>
        <Box component="nav">
            <AppBar position="static" style={{background: "#212121"}}>
                <Toolbar>
                    <IconButton>
                    <ArrowBack style={{color: "white"}} />
                    </IconButton>
                    <Typography variant="h5">
                        Mario Castro's Portfolio
                </Typography>
                </Toolbar>
            </AppBar>
        </Box>
        </>    
    )
}

export default Navbar
